import React from 'react';
import './Contacts.scss'

function Contacts() {
    return ( 

        <section className='contact--container'>
            <h1>Vamos nos conhecer!</h1>
          <form>
            <input> Nome </input>
            <input> Email </input>

          </form>
        </section>
        

     );
}

export default Contacts;
